import Home from"./Home";
import Service from"./Service";
import About from"./About";
import Contact from"./Contact";
import Navbar from"./Navbar";
import"./index.css";
//import{ Switch,Route,Redirect} from "react-router-dom";
class App{
    render(){
        return(
        <div className="App">
        <Navbar/>
        <Home/>
        <About/>
        <Service/>
        <Contact/>
        
        </div>
        );
    }
}

export default App;
